			<node ID="ID_604249435" TEXT="Do ellipsis parable and hyperbole from rhetoric have anything in common with the geometric curves ellipse parabola and hyperbola used in mathematics?. There are three geometric curves known as conic sections:. Ellipse: a curve on a plane surrounding two focal points such that a straight line drawn from one of the focal points to any point on the curve and then back to the other focal point " />
